/// <summary>
/// Retrieves whether the specified job type is allowed in Manufacturing execution.
/// </summary>
/// <param name="_type">
/// The Job type to check whether it is allowed.
/// </param>
/// <returns>
/// true if the job type is allowed; otherwise, false2.
/// </returns>
public boolean allowJobType(RouteJobType _type)
{
    boolean ret;

    switch (_type)
    {
        case RouteJobType::QueueBefore :
            ret = this.AllowProdQueueBefore;
            break;
        case RouteJobType::Setup       :
            ret = this.AllowProdSetup;
            break;
        case RouteJobType::Process     :
            ret = this.AllowProdProcess;
            break;
        case RouteJobType::Overlap     :
            ret = this.AllowProdOverlap;
            break;
        case RouteJobType::Transport   :
            ret = this.AllowProdTransport;
            break;
        case RouteJobType::QueueAfter  :
            ret = this.AllowProdQueueAfter;
            break;
    }

    return ret;
}

/// <summary>
/// Deletes the <c>JmgProdParametersDim</c> record from the database.
/// </summary>
/// <remarks>
/// Deletion is only allowed if the <c>JmgProdParametersDim</c> record refers to a
/// site specific set of parameters.
/// </remarks>
public void delete()
{
    if (this.InventDimId != InventDim::inventDimIdBlank())
    {
        super();
    }
}

/// <summary>
///    Initializes values either from the company wide record, if the record exists, or with default
///    values.
/// </summary>
public void initValue()
{
    JmgProdParametersDim parameter;

    super();

    //The JmgProdParametersDim::find method is not used here because it would result in an indefinite loop
    select firstonly parameter where parameter.InventDimId == InventDim::inventDimIdBlank();
    if (parameter)
    {
        //If any non-site specific records exists, then initialize from that
        buf2Buf(parameter,this);
