        this.FeedbackAcceptOverDelivery         = NoYes::No;
        this.FeedbackAcceptUnderDelivery        = NoYes::No;
        this.FeedbackOverDeliveryPercentage     = 0.0;
        this.FeedbackUnderDeliveryPercentage    = 0.0;
        this.FeedbackValidateMethod             = JmgFeedbackValidateMethod::ProdPlannedQty;
        this.MaxQty                             = 9999999;
        this.PostTimeAutomatically              = NoYes::Yes;
        this.ProdDimensionFrom                  = JmgDimensionFrom::Job;
        this.ReportFinishAcceptError            = NoYes::No;
        this.ReportFinishBOMAutoConsump         = BOMAutoConsump::Never;
        this.ReportFinishBOMJournalNameId       = '';
        this.ReportFinishEndJob                 = NoYes::No;
        this.ReportFinishEndPicklist            = NoYes::No;
        this.ReportFinishEndRouteCard           = NoYes::No;
