/// <summary>
/// Gets the <see cref="T:InventSite" /> record based on the site ID in the related <see
/// cref="T:InventDim" /> record.
/// </summary>
/// <returns>
/// The related <see cref="T:InventSite" /> record.
/// </returns>
InventSite inventSite()
{
    return InventSite::find(InventDim::find(this.InventDimId).InventSiteId);
}

/// <summary>
/// Gets the name of the associated site.
/// </summary>
/// <returns>
/// The name of the associated site.
/// </returns>
display InventSiteName siteName()
{
    return this.inventSite().Name;
}

/// <summary>
/// Retrieves a <c>JmgProdParametersDim</c> record with the specified inventory dimension ID.
/// </summary>
/// <param name="_inventDimId">
/// The inventory dimension ID to search for.
/// </param>
/// <param name="_forUpdate">
/// A Boolean value that specifies whether the returned record must be selected for update.
/// </param>
/// <returns>
/// A <c>JmgProdParametersDim</c> record that has the specified inventory dimension ID.
/// </returns>
/// <remarks>
/// If no record exist for the specified inventory dimension ID, the non-site specific parameters is
/// returned.
/// </remarks>
public static JmgProdParametersDim find(InventDimId _inventDimId, boolean _forUpdate = false)
{
    JmgProdParametersDim jmgProdParametersDim;
    jmgProdParametersDim.selectForUpdate(_forUpdate);

    _inventDimId = JmgProdParameters::resolveInventDimId(_inventDimId);

    if (JmgProdParameters::find().ProdParamInventDimLookup == ProdParamInventDimLookup::Company)
    {
        _inventDimId = InventDim::inventDimIdBlank();
    }

    select firstonly jmgProdParametersDim
        where jmgProdParametersDim.InventDimId == _inventDimId;

    if (!jmgProdParametersDim && _inventDimId != InventDim::inventDimIdBlank())
    {
        //If not found, then get the non-site specific value
        select firstonly jmgProdParametersDim
            where jmgProdParametersDim.InventDimId == InventDim::inventDimIdBlank();
    }

    if (!jmgProdParametersDim && !jmgProdParametersDim.isTmp())
    {
        Company::createParameter(jmgProdParametersDim);
    }

    return jmgProdParametersDim;
}

/// <summary>
/// Determines if the digital signature is supported in the shop floor module for report as finished
/// </summary>
/// <returns>
/// true if it is supported, otherwise false.
/// </returns>
public static boolean isSignatureSupportedForReportAsFinished()
{
    JmgProdParametersDim jmgProdParametersDim = JmgProdParametersDim::find(InventDim::inventDimIdBlank());

    return (jmgProdParametersDim.RecId == 0
            || jmgProdParametersDim.ReportFinishUseSFCParameters == NoYes::No);
}

/// <summary>
/// Determines if concurrent deletes should throw exception.
/// </summary>
/// <returns>true if exception should be thrown; otherwise false.</returns>
public boolean shouldThrowExceptionOnZeroDelete()
{
    return true;
}
